xodus of (Pac-Man ~ 2Pac-Man) (Don-Key Kong ~ Don KeyOn Kong)<br /> <br /> Lambo Lambeau Lamborghini &#125;( Keyon Idell Jovon Lamberth )&#123;<br /> <br /> Idell`s Dells Noah`s Knowles Art Ark of Milwaukee He Brew Brewers<br /> <br /> (Milwaukee Milkey Way) She`Brews (liquor lick Her) Wisconsin Wii<br /> <br /> Nine Ten Do Nintendo do, re, mi ` piano Keanu chords<br /> <br /> Sega Book of Genesis Exodus Leviticus Numbers Deuteronomy Joshua Song<br /> <br /> Lamb Bow White Horse Horus Horoscope Optimus Prime<br /> George Neo Geo ~ KEANU CHRISTOPHER REVEE REVEES ♥<br /> <br /> Apocalipsis 6<br /> First Seal: The Conqueror<br /> Now I saw when the Lamb opened one of the seals; and I heard one of the four living creatures saying with a voice like thunder, “Come and see.”<br /> And I saw, and behold a white horse: and he that sat on him had a bow; and a crown was given unto him: and he went forth , and to conquer.<br /> <br /> ~ Amber la Cordero O Red Roc Alleluia; Lamb ~<br /> <br /> Let us be glad and rejoice, and give honour to him: for the marriage of the Lamb is come, and his wife hath made herself ready.<br /> <br /> And to her was granted that she should be arrayed in fine linen, clean and white: for the fine linen is the righteousness of saints.<br /> <br /> And he saith unto me, Write, Blessed are they which are called unto the marriage supper of the Lamb. And he saith unto me, These are the true sayings of God.<br /> <br /> And I fell at his feet to worship him. And he said unto me, See thou do it not: I am thy fellowservant, and of thy brethren that have the testimony of Jesus: worship God: for the testimony of Jesus is the spirit of prophecy.<br /> <br /> And I saw heaven opened, and behold a white horse; and he that sat upon him was called Faithful and True, and in righteousness he doth judge and make war.<br /> <br /> His eyes were as a flame of fire, and on his head were many crowns; and he had a name written, that no man knew, but he himself.<br /> <br /> And he was clothed with a vesture dipped in blood: and his name is called The Word of God.<br /> <br /> And the armies which were in heaven followed him upon white horses, clothed in fine linen, white and clean.<br /> <br /> And out of his mouth goeth a sharp sword, that with it he should smite the nations: and he shall rule them with a rod of iron: and he treadeth the winepress of the fierceness and wrath of Almighty God.<br /> <br /> And he hath on his vesture and on his thigh a name written, KING OF KINGS, AND LORD OF LORDS.<br /> <br /> And I saw an angel standing in the sun; and he cried with a loud voice, saying to all the fowls that fly in the midst of heaven, Come and gather yourselves together unto the supper of the great God;<br /> <br /> That ye may eat the flesh of kings, and the flesh of captains, and the flesh of mighty men, and the flesh of horses, and of them that sit on them, and the flesh of all men, both free and bond, both small and great.<br /> <br /> And I saw the beast, and the kings of the earth, and their armies, gathered together to make war against him that sat on the horse, and against his army.<br /> <br /> And the beast was taken, and with him the false prophet that wrought miracles before him, with which he deceived them that had received the mark of the beast, and them that worshipped his image. These both were cast alive into a lake of fire burning with brimstone.<br /> <br /> And the remnant were slain with the sword of him that sat upon the horse, which sword proceeded out of his mouth: and all the fowls were filled with their flesh.<br /> <br /> <a href="http://www.facebook.com/video/video.php?v=290557217644751&amp;saved" target="_blank" rel="nofollow"><span>http://www.facebook.com/</span><wbr /><span class="word_break"></span><span>video/</span><wbr /><span class="word_break"></span><span>video.php?v=290557217644751</span><wbr /><span class="word_break"></span>&amp;saved</a><br /> <br /> I believe I can fly<br /> I believe I can touch the sky<br /> I think about it every night and day<br /> Spread my wings and fly away</span><span class="text_exposed_hide"><span class="text_exposed_link"><a onclick="CSS.addClass($(&quot;id_4ec65b7ca94a45f82911091&quot;), &quot;text_exposed&quot;);">See More</a></span></span></div><span class="translatedBody"></span></span><span><div><div class="mvm uiStreamAttachments clearfix hidden_elem" data-ft="&#123;&quot;type&quot;:10&#125;" id="u7unna_5"><div class="UIImageBlock clearfix"><a class="uiVideoThumb UIImageBlock_Image UIImageBlock_MED_Image" ajaxify="/ajax/flash/expand_inline.php?target_div=u7unna_4&amp;context=story&amp;max_width=310&amp;max_height=310&amp;v=290557217644751" rel="async" href="http://www.facebook.com/video/video.php?v=290557217644751" onclick="CSS.addClass(this, &quot;uiVideoThumbLoading&quot;);" id="u7unna_4" target="" data-ft="&#123;&quot;type&quot;:42,&quot;video_type&quot;:&quot;motion&quot;&#125;" tabindex="-1" aria-hidden="true"><img class="img" src="http://vthumb.ak.fbcdn.net/hvthumb-ak-snc6/159022_290622620971544_290557217644751_53991_1346_t.jpg" alt="" /><i></i></a><div class="UIImageBlock_Content UIImageBlock_MED_Content fsm fwn fcg"><div class="uiAttachmentTitle" data-ft="&#123;&quot;type&quot;:11&#125;"><strong><a href="http://www.facebook.com/photo.php?v=290557217644751" target="">Return of King Jesus Emanuel thee Christ _&#125;~~&gt; Xmas Raper wRappin</a></strong> </div><span class="caption"></span><div class="mts uiAttachmentDesc translationEligibleUserAttachmentMessage"><div id="id_4ec65b7caa88e1a03294376" class="text_exposed_root"><span>‎~-ღೋ-~&#125;_)-~&#039;;.;~;&#039;;~;.;_)_&#125;~-</span><wbr /><span class="word_break"></span>~-&gt; &quot;I say to you today, my friends, so even thoug<span class="text_exposed_hide">...</span><span class="text_exposed_show">h we face the difficulties of today and tomorrow, I still have a dream. It is a dream deeply rooted in the American dream.  I have a dream that one day this nation will rise up and live out the true meaning of its creed: &quot;We hold these truths to be self-evident: that all men are created equal.&quot;  I have a dream that one day on the red hills of Georgia the sons of former slaves and the sons of former slave owners will be able to sit down together at the table of brotherhood.  I have a dream that one day even the state of Mississippi, a state sweltering with the heat of injustice, sweltering with the heat of oppression, will be transformed into an oasis of freedom and justice.  I have a dream that my four little children will one day live in a nation where they will not be judged by the color of their skin but by the content of their character.  I have a dream today.  I have a dream that one day, down in Alabama, with its vicious racists, with its governor having his lips dripping with the words of interposition and nullification; one day right there in Alabama, little black boys and black girls will be able to join hands with little white boys and white girls as sisters and brothers.  I have a dream today.  I have a dream that one day every valley shall be exalted, every hill and mountain shall be made low, the rough places will be made plain, and the crooked places will be made straight, and the glory of the Lord shall be revealed, and all flesh shall see it together.  This is our hope. This is the faith that I go back to the South with. With this faith we will be able to hew out of the mountain of despair a stone of hope. With this faith we will be able to transform the jangling discords of our nation into a beautiful symphony of brotherhood. With this faith we will be able to work together, to pray together, to struggle together, to go to jail together, to stand up for freedom together, knowing that we will be free one day.  This will be the day when all of God&#039;s children will be able to sing with a new meaning, &quot;My country, &#039;tis of thee, sweet land of liberty, of thee I sing. Land where my fathers died, land of the pilgrim&#039;s pride, from every mountainside, let freedom ring.&quot;  And if America is to be a great nation this must become true. So let freedom ring from the prodigious hilltops of New Hampshire. Let freedom ring from the mighty mountains of New York. Let freedom ring from the heightening Alleghenies of Pennsylvania!  Let freedom ring from the snowcapped Rockies of Colorado!  Let freedom ring from the curvaceous slopes of California!  But not only that; let freedom ring from Stone Mountain of Georgia!  Let freedom ring from Lookout Mountain of Tennessee!  Let freedom ring from every hill and molehill of Mississippi. From every mountainside, let freedom ring.  And when this happens, when we allow freedom to ring, when we let it ring from every village and every hamlet, from every state and every city, we will be able to speed up that day when all of God&#039;s children, black men and white men, Jews and Gentiles, Protestants and Catholics, will be able to join hands and sing in the words of the old Negro spiritual, &quot;Free at last! free at last! thank God Almighty, we are free at last!&quot; Ahmen!!! ♥ </span><span class="text_exposed_hide"><span class="text_exposed_link"><a onclick="CSS.addClass($(&quot;id_4ec65b7caa88e1a03294376&quot;), &quot;text_exposed&quot;);">See More</a></span></span></div><div><div class="fsm fwn fcg">Length: <span class="uiAttachmentDetails" data-ft="&#123;&quot;type&quot;:12&#125;">‎10:02</span></div></div></div></div></div></div><a onclick="CSS.hide(this); CSS.show($(&#039;u7unna_5&#039;));">Expand Preview<i class="uiMoreLinkCaret img sp_6h8b4g sx_5773e1"></i></a></div></span><div class="commentActions fsm fwn fcg"><abbr title="Thursday, November 17, 2011 at 4:15am" data-date="Wed, 16 Nov 2011 19:15:00 -0800">Yesterday at 4:15am</abbr> · <span class="comment_like_5569768 fsm fwn fcg" data-ft="&#123;&quot;type&quot;:36&#125;"><button class="stat_elem as_link cmnt_like_link" type="submit" name="like_comment_id[556